        // const requestBody = {
        //     "officeName": officeName,
        //     "officeNumber": officeNumber
        // };

        //пока токена нет
        let token = "eyJhbGciOiJIUzI1NiJ9.eyJqdGkiOiI4ZjMzMGJkZi0wOWE0LTQ3MzUtYTk5Yi1lZWIwMWY2MjJiZGQiLCJzdWIiOiJrc3U1IiwiaWF0IjoxNzEwMDk1MjczLCJleHAiOjE3MTAwOTg4NzN9.Muq3pfEDDKIVhIL_h2rAOIVoIWH179jXe5t8Hl27Qx8";
        localStorage.setItem("token", token);
        //


        try {
            //потом заменить на норм переменную из url
            const idd = '1d8bd2d8-456e-446c-b078-4d92af73c374';
            const response = fetch(`http://158.160.147.51:8181/api/office/${idd}`, {
                method: 'GET',
                headers: {
                    'Content-Type': 'application/json',
                    'Authorization': 'Bearer ' + localStorage.getItem('token')
                },
                // body: JSON.stringify(requestBody)
            }).then(response => {
                if (response.status === 200) {
                    return response.json();
                } else {
                    console.log(response);
                    throw new Error();
                }

            }).then(response => {
                console.log("rrr", response);
                return response.data;
            }).catch(error => {
                console.log('Ошибка:', error);
            });

        } catch (error) {
            console.log('Ошибка:', error);
        }
    };



    render() {
        return (
            <div className="keyCardContainer">
                <KeyCard />
                <KeyCard />
                <KeyCard />
            </div>
        );
    }
}

export default KeyCardContainer;
